import React, { Component } from 'react';
//import axios from 'axios'
//import './css/style.css'
//import '../App.css'

class Login extends Component{
    constructor(props){
        super(props)
        this.state = {
            email: "",
            password: "",
        }
    }

changePassword = (e)=> {
    this.setState({
        name: e.target.value
    }); //semicolon reqd
}

changeEmail = (e)=> {
    this.setState({
        email: e.target.value
    }); 
}

