 //}

render(){
    return(
        
         <form className='flex flex-col w-55 border-2 rounded-lg background-color1 gap-1 object-centre' >
            <label className='background-color-blue p-2'>Email: </label>
            <input className='input' type="text" placeholder="Email" onChange={this.changeEmail}></input>
            <br/>
            <label className='background-color-blue p-2'>Password: </label>
            <input className='input'  type="Text" placeholder="Password" onChange={this.changePassword}></input>
            <br/>
            <button className='btn' onClick={this.submitForm}>SUBMIT</button> 
            <br/>
            <label className='background-color-blue p-2 font-sm' w-2>Don't have an account? </label>
            <br/>
            <button className='btn font-sm' onClick={this.submitForm}>Sign-Up</button> 
            
        </form>
        
    );
}
}
export default Login;
